INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(1, 'Egg Rolls', 'Very popular in the west although not eaten in China, egg rolls are a larger, bulkier version of Spring rolls.  They are normally filled with barbecued pork or shrimp - vegetables can include cabbage, celery, suey choy, and/or bean sprouts.', 'Appetizers', 'Chinese', 250, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(2, 'Spring Rolls', 'A lighter, more delicate version of egg rolls, made with a flour and water wrapper (no egg).  Like egg rolls, spring rolls are deep-fried.', 'Appetizers', 'Chinese', 320, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(3, 'Deep Fried Wontons', 'Wonton wrappers filled with ground pork and a variety of vegetables and seasonings before deep-frying.', 'Appetizers', 'Chinese', 420, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(4, 'Crab Rangoon', 'A variation on deep-fried wontons that has become very popular in some parts of the United States, although it is not an authentic Chinese appetizer.  The wontons are stuffed with crab, cream cheese and scallions before deep-frying.', 'Appetizers', 'Chinese', 210, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(5, 'Egg Drop Soup', 'A classic dish -  flavored chicken broth or stock topped with silken threads of egg. It usually includes a green onion garnish, and sometimes frozen peas are added to the stock.', 'Soups', 'Chinese', 130, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(6, 'Hot and Sour Soup', 'Regional variations of this soup are found throughout China.  All contain bean curd, Chinese black mushrooms and usually pork, but the remaining ingredients can vary. I think it tastes best when chicken stock is added.', 'Soups', 'Chinese', 200, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(7, 'Wonton Soup', 'The word wonton translates into "swallowing a cloud" and in this dish the wontons floating in the soup do resemble tiny clouds.  The wontons are filled with a mixture of meat (usually pork) and seasonings and boiled, and then added to a stock.', 'Soups', 'Chinese', 120, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(8, 'Ants Climbing Trees (Ma Yi Shang Shu)', 'This is a very flavourful, albeit spicy, Szechuan dish in which marinated pork is cooked in a spicy sauce and served over cellophane (bean thread) noodles.', 'Dinner', 'Chinese', 620, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(13, 'Cheng Du Chicken (Chili Chicken Cubes)', 'A classic Szechuan dish. Cubed chicken breasts are marinated and deep-fried; the sauce includes hot bean sauce, freshly ground Szechuan pepper, sugar, and vinegar.', 'Dinner', 'Chinese', 730, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(15, 'Chow Mein (Fried noodles)', 'In this dish the noodles and vegetables are stir-fried separately and added back together at the end of the cooking process.  The noodles can be soft or crispy depending on how long they are cooked in oil.  Also, chow mein can be made with either thick or thin noodles. There is a gravy, either added to the noodles while they are stir-frying or at the final stage of cooking. Chicken is a popular meat to use in chow; shrimp or pork are used as well.', 'Dinner', 'Chinese', 390, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(17, 'Dou Ban Yu', 'Fish in Hot Sauce.', 'Dinner', 'Chinese', 320, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(18, 'Dry Garlic Spareribs', 'Spareribs are simmered twice - the second time in a flavorful sauce that includes brown sugar and dry mustard.', 'Dinner', 'Chinese', 625, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(19, 'Fried Rice', 'Cold, previously cooked rice is combined with scrambled egg and other ingredients to add texture and flavor.  Restaurants offer a number of fried rice dishes, from beef, chicken or shrimp to mushroom or popular dishes such as Yangchow Fried Rice.', 'Dinner', 'Chinese', 350, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(22, 'Kung Pao Chicken (Kung Pao Chi Ting)', 'Deep-fried diced chicken and roasted peanuts; a spicy dish made with chili peppers.', 'Dinner', 'Chinese', 230, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(26, 'Mein', 'Noodles.', 'Dinner', 'Chinese', 200, );
