(28, 'Moo Goo Gai Pan', 'Stir-fried chicken and mushrooms.', 'Dinner', 'Chinese', 328, );
INSERT INTO `menuitem` (`ItemID`, `itemName`, `description`, `category`, `cuisine`, `price`, `pic`) VALUES
(31, 'Salt and Pepper Squid', 'Squid rings are coated with a salt and pepper mixture and deep-fried. Salt and toasted Szechuan peppercorns are always found in the salt and pepper mix; toasted black peppercorns and chili flakes may be added. In restaurants, the dish is frequently finished by stir-frying the squid with onion and a mix of bell peppers and hot red chili peppers.', 'Dinner', 'Chinese', 630, );
